import React from "react";
import forbidden from "./img/forbidden.png";

const useStyles = makeStyles(() => ({
    container: {
      minHeight: "100vh",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
    },
    errorCode: {
        marginTop: 16
    }
  }));
const Forbidden = () => {
  return <img src={forbidden} alt="forbidden" />;
};

export default Forbidden;
